import logo from './logo.svg';
import './App.css';
import Main from './components/main';
import { Route } from 'react-router-dom';
import Error408 from './components/Error408';


function App() {
  return (
    <div className="App">
      <switch>
        <Route path='/error' component={Error408} />
        <Route path ='/' component={Main} />
      </switch>
    </div>
  );
}

export default App;
